import { FaTimes } from 'react-icons/fa'

const EduInfo = ({ edu, onDelete }) => {
    return (
        <div>
            <h3>Education<FaTimes style={{color:'red',cursor:'pointer'}} onClick={() => onDelete.deleteEdu(edu.id)}/></h3>
            <h3>University</h3>
            <h3>Degree</h3>
            <h4>Date</h4>
        </div>
    )
}

export default EduInfo
